<!doctype html><html><head>
    <meta charset="utf-8">
    
    <style>
        body {
            margin: 0;
            overflow: hidden;
            font-family: Arial, Helvetica, sans-serif;
        }

        .container {
            display: flex;
            flex-direction: column;
            height: 100vh;
        }

        #chart {
            flex: 1 1 auto;
        }

        .footer-wrapper {
            position: relative;
            display: flex;
            justify-content: center;
            align-items: flex-end;
            width: 100%;
            padding: 0 10px 10px 10px;
            box-sizing: border-box;
            min-height: 40px;
        }

        .legend {
            display: flex;
            justify-content: center;
            padding: 12px 0;
            z-index: 2;
            white-space: nowrap;
        }

        #chart-footnote {
            position: absolute;
            right: 10px;
            bottom: 12px;
            text-align: right;
            font-size: 11px;
            color: #888;
            font-style: italic;
            z-index: 1;
            pointer-events: none;
        }

        @media (max-width: 850px) {
            .footer-wrapper {
                flex-direction: column;
                align-items: center;
            }

            #chart-footnote {
                position: static;
                margin-top: 5px;
                text-align: center;
                max-width: 100%;
            }
        }

        .legend-item {
            display: flex;
            align-items: center;
            margin: 0 24px;
            font-size: 14px;
        }

        .box {
            width: 14px;
            height: 14px;
            margin-right: 10px;
            border: none;
        }

        .pos {
            background: #2d7c2d;
        }

        .neg {
            background: #8B1A0F;
        }

        .tooltip-table {
            width: 100%;
        }

        .tooltip-table .data {
            text-align: right;
        }

        .tooltip-footer {
            opacity: .5;
        }

        tspan {
            font-family: "Helvetica", "Arial", sans-serif;
            font-size: 100px;
            font-style: oblique;
        }

        .custom-label {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 13px;
            fill: #000;
            opacity: 1;
            font-weight: normal;
            transition: opacity 0.4s ease, font-size 0.4s ease, font-weight 0.4s ease;
            pointer-events: none;
            transform-origin: center;
        }

        .custom-label.collision {
            opacity: 0.3;
        }

        .custom-label.hover {
            opacity: 1 !important;
            font-size: 16px !important;
            font-weight: bold !important;
        }

        .custom-label,
        text.custom-label {
            font-family: Arial, Helvetica, sans-serif !important;
            font-size: 13px;
            fill: #000 !important;
            stroke: none !important;
            font-weight: normal !important;
        }

        .connector-line {
            stroke: #000;
            stroke-width: 1px;
            opacity: 0.5;
            pointer-events: none;
        }
    </style>
